import React from 'react';
import Login from '../../components/account/login';
import { gql, useQuery } from '@apollo/client'

const query = gql`
query{
    loginPage{
      hero{
        title
        background{
          url
        }
      }
    }
  }
`

const login = () => {
    const { data, loading } = useQuery(query)
    if (loading)
        return <Loading/>
    return <Login hero={data.loginPage.hero}/>;
}

export default login;
